import React, { useState } from 'react'
import {Link,useNavigate} from "react-router-dom";
import axios from "axios";
export default function Signup() {
    let navigate = useNavigate();

    const [Credentials,setcredentials] = useState({
        name:"",
        password:"",
        email:"",
        usertype:""
    })

    const [usertype,setusertype] = useState("");
    const optionchanged = (e)=>{
        setusertype(e.target.value);
    }
    const update = (e)=>{
        setcredentials({...Credentials,[e.target.name]:e.target.value});
    }
    const handleSubmit = async (e)=>{
        e.preventDefault();

        try{
            axios.post("http://localhost:5000/api/createuser",{
             Credentials
            })
        }
        catch(err){
            console.log(err)
        }
    }

    console.log(usertype);





    return (

        <>
            <section class="vh-100 bg-image"
                style={{ 'background-image': `url('https://mdbcdn.b-cdn.net/img/Photos/new-templates/search-box/img4.webp')` }}>
                <div class="mask d-flex align-items-center h-100 gradient-custom-3">
                    <div class="container h-100">
                        <div class="row d-flex justify-content-center align-items-center h-100">
                            <div class="col-12 col-md-9 col-lg-7 col-xl-6">
                                <div class="card" style={{ 'border-radius': '15px' }}>
                                    <div class="card-body p-5">
                                        <h2 class="text-uppercase text-center mb-3">Create an account</h2>

                                        <form action="POST">

                                            <div class="form-outline mb-2">
                                                <input type="text" name="name" id="form3Example1cg" class="form-control form-control-lg" value={Credentials.name} onChange={update}/>
                                                <label class="form-label" for="form3Example1cg">Your Name</label>
                                            </div>

                                            <div class="form-outline mb-2">
                                                <input type="email" name="email" id="form3Example3cg" class="form-control form-control-lg" value={Credentials.email} onChange={update}/>
                                                <label class="form-label" for="form3Example3cg">Your Email</label>
                                            </div>

                                            <div class="form-outline mb-2">
                                                <input type="password" id="form3Example4cg" class="form-control form-control-lg" name="password" value={Credentials.password} onChange={update} />
                                                <label class="form-label" for="form3Example4cg">Password</label>
                                            </div>

                                            <div class="d-md-flex justify-content-start align-items-center mb-4 py-2">
                                                <div class="form-check form-check-inline mb-0 me-4">
                                                    <input class="form-check-input" type="radio" name="usertype" id="Coustomer"
                                                        value="Coustomer" checked={usertype==="Coustomer"} onChange={optionchanged}/>
                                                    <label class="form-check-label" for="coustomer">Coustomer</label>
                                                </div>

                                                <div class="form-check form-check-inline mb-0 me-4">
                                                    <input class="form-check-input" type="radio" name="usertype" id="merchant"
                                                        value="Merchant" checked={usertype==="Merchant"}
                                                        onChange={optionchanged} />
                                                    <label class="form-check-label" for="merchant">Merchant</label>
                                                </div>
                                            </div>

                                            <div class="form-check d-flex justify-content-center mb-3">
                                                <input class="form-check-input me-2" type="checkbox" value="" id="form2Example3cg" />
                                                <label class="form-check-label" for="form2Example3g">
                                                    I agree all statements in <a href="#!" class="text-body"><u>Terms of service</u></a>
                                                </label>
                                            </div>

                                            <div class="d-flex justify-content-center">
                                                <button onClick={handleSubmit} type="button"
                                                    class="btn btn-success btn-block btn-lg gradient-custom-4 text-body">Register</button>
                                            </div>

                                            <p class="text-center text-muted mt-3 mb-0">Have already an account? <Link to="/login"
                                                class="fw-bold text-body"><u>Login here</u></Link></p>

                                        </form>

                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>


        </>
    )
}
